import React, { useState, useEffect } from "react";
import { useParams, NavLink } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { getParoisse } from "../actions/paroisse";
import { isEmpty } from "../components/utils";

import HeadBar from "../components/HeadBar/HeadBar";

const Paroisse = () => {
  const [isLoading, setIsLoading] = useState(true);
  const { id } = useParams();
  const dispatch = useDispatch();

  let paroisse = {};
  paroisse = useSelector((state) => state.paroisse);

  useEffect(() => {
    if (isLoading) {
      dispatch(getParoisse(id));
    }
  }, [id]);

  return (
    <div className="paroisse-container">
      <HeadBar headerName={"Paroisses"} />
      {!isEmpty(paroisse) ? <>

      </> : <></>}


      <div className="paroisse-infos-container">
        <div className="paroisse-infos-left">
          {paroisse?.picture.length > 0 ? (
            <img
              src={process.env.PUBLIC_URL + paroisse.picture}
              alt={paroisse.name}
            />
          ) : null}
        </div>

        <div className="paroisse-infos-right"></div>
      </div>

      <div className="paroisse-header">
        <h1>Paroisse</h1>
      </div>
      <div className="paroisse-picture"></div>
      <div className="paroisse-name">
        <p>{paroisse.name}</p>
      </div>
    </div>
  );
};

export default Paroisse;
